import React from 'react';

const TarefaLista = () => {
    const tarefas = [
        { id: 1, descricao: 'Tarefa 1', concluida: false },
        { id: 2, descricao: 'Tarefa 2', concluida: true },
        { id: 3, descricao: 'Tarefa 3', concluida: false }
    ];

    return (
        <table>
            <thead>
                <tr>
                    <th>ID</th>
                    <th>Descrição</th>
                    <th>Concluída</th>
                </tr>
            </thead>
            <tbody>
                {tarefas.map(tarefa => (
                    <tr key={tarefa.id}>
                        <td>{tarefa.descricao}</td>
                    </tr>
                ))}
            </tbody>
        </table>
    );
};

export default TarefaLista;
